style.css:
@-moz-document domain(roblox.com) {
#fb-root
  {
    width: 100% !important;
    height: 100% !important;
    position: fixed !important;
    background: linear-gradient(rgba(0, 0, 0, 0.40), rgba(0, 0, 0, 0.40)), url("https://i.imgur.com/pQc2EEh.gif") !important;
 /* Background */
    background-size: cover !important;

  }
.btr-game-main-container .game-main-content {
    background: none;
    margin-top: 20px;
    padding-left: 0;
    padding-right: 0;
}
.upvote {
    color: #fff;
    transition: transform .2s;
}

.upvote:hover {
               -ms-transform: scale(1.05);
  -webkit-transform: scale(1.05);
  transform: scale(1.05);                                          
        }
.downvote {
    color: #fff;
    transition: transform .2s;
}

.downvote:hover {
               -ms-transform: scale(1.05);
  -webkit-transform: scale(1.05);
  transform: scale(1.05);                                          
        }
.inline-social.page-content {
    max-width: 1000px;
    background: linear-gradient(rgba(0, 0, 0, 0.65), rgba(0, 0, 0, 0.65));
}
.robux-row {
    background: linear-gradient(rgba(0, 0, 0, 0.45), rgba(0, 0, 0, 0.45));
    transition: transform .2s;
}
      .robux-row:hover {
               -ms-transform: scale(1.05);
  -webkit-transform: scale(1.05);
  transform: scale(1.05);                                          
        }
  #navigation {
    background-color: transparent;
    transition: transform .2s;
                        background: linear-gradient(rgba(0, 0, 0, 0.45), rgba(0, 0, 0, 0.45));
   }
      #navigation:hover {
            box-shadow: 0 0 12px 0.5px #616161;
               -ms-transform: translateX(0.10em);
  -webkit-transform: translateX(0.10em);
  transform: translateX(0.10em);                                            
        }
#header {
    background: linear-gradient(rgba(0, 0, 0, 0.85), rgba(0, 0, 0, 0.85))
}
@keyframes wobble
  {
from {
        transform: rotate(0deg);
  }

  to
  {
    transform: rotate(360deg);
  }
}

.icon-logo-r,
.light-theme .icon-logo-r,
.dark-theme .icon-logo-r
{
  animation: wobble 4s linear infinite;
}
.dark-theme .game-card-container {
 transition: transform .2s ease;
}
.dark-theme .section-content {
    background: none;
    color:fff;
}
.dark-theme .content {
    background-color: transparent;
    color: #fff;
}
.dark-theme .stack .stack-list .stack-row {
    background: linear-gradient(rgba(0, 0, 0, 0.45), rgba(0, 0, 0, 0.45));
    color:fff;
}
.rbx-tab-heading {
display: flex;
padding: 9px 5px 9px 9px;
}
#RepositionBody, #MasterContainer, #footer-container, #Body, #BodyWrapper {
     background: linear-gradient(rgba(0, 0, 0, 0.40), rgba(0, 0, 0, 0.40)), url("https://i.imgur.com/pQc2EEh.gif") !important;
                            background-size: 100%;
    background-repeat: no-repeat;
    background-attachment: fixed !important;
}
#build-page .item-table {
    border-spacing: 0;
    border-collapse: collapse;
    background: linear-gradient(rgba(0, 0, 0, 0.40), rgba(0, 0, 0, 0.40)) !important;
     transition: transform .2s ease;
}
.people-list .friend {
    height: 148px;
     transition: transform .2s ease;
}
.people-list .friend:hover {

               -ms-transform: scale(1.05);
  -webkit-transform: scale(1.05);
  transform: scale(1.05);
}


#build-page .item-table:hover {

               -ms-transform: scale(1.05);
  -webkit-transform: scale(1.05);
  transform: scale(1.05);
}
#MyCreationsTab, #GroupCreationsTab {
    width: 0px;
    height: 0px;
    padding-right: 0;
}
#LibraryTab {
    font-size: 12px;
    background: linear-gradient(rgba(0, 0, 0, 0.45), rgba(0, 0, 0, 0.45));
    margin-top: 40px;
}

div#catalog div#dropdown ul li a {
   border-radius: 25px;
}
.assetTypeFilter:hover, .verticaltab:hover {
    background-color: var(--background-color) !important;
}
.btn-control {
border-radius: 25px;
}
.CatalogItemOuter {
    float: left;
    padding: 24px 11px;
    z-index: 1;
}
.dark-theme .menu-vertical {
    background: linear-gradient(rgba(0, 0, 0, 0.75), rgba(0, 0, 0, 0.75));
    color: #fff;
}
.dark-theme .game-card-container:hover {
box-shadow: 0px 0px 12px #616161;
-ms-transform: translateX(0.10em);
  -webkit-transform: translateX(0.10em);
  transform: translateX(0.10em);     
}
.tab-container>div {
background: linear-gradient(rgba(0, 0, 0, 0.25), rgba(0, 0, 0, 0.25));
    border-radius: 25px;
    transition: transform .2s ease;
    margin-left:16px;
}
.tab-container>div:hover {

               -ms-transform: scale(1.05);
  -webkit-transform: scale(1.05);
  transform: scale(1.05);

}
.icon-nav-settings {
    animation: wobble 4s linear infinite;
    -webkit-animation: wobble 4s linear infinite;
}
}
